package com.lightning.bean.wangzelong;

public class Account {
	public int account_indent;//订单id
	public float account_money;//订单收费
	public int getAccount_indent() {
		return account_indent;
	}
	public void setAccount_indent(int account_indent) {
		this.account_indent = account_indent;
	}
	public float getAccount_money() {
		return account_money;
	}
	public void setAccount_money(float account_money) {
		this.account_money = account_money;
	}
	
	
	public Account() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Account(float account_money) {
		super();
		this.account_money = account_money;
	}
	public Account(int account_indent, float account_money) {
		super();
		this.account_indent = account_indent;
		this.account_money = account_money;
	}
	
}
